                                        if (specCheck(unicodeStored) || unicodeStored.includes("<:") || unicodeStored.includes("<a:")) {
                                            var emoji;
                                            if (unicodeStored.includes("<:") || unicodeStored.includes("<a:")) {
                                                unicodeStored = unicodeStored.replace(/\D/g, '');
                                                emoji = localEmoji.filter(emojiT => emojiT.id == unicodeStored);
                                                if (emoji.length > 0) {
                                                    unicodeStored = emoji[0];
                                                    delete unicodeStored['guild']
                                                    reactionArray.push([unicodeStored, roleMentioned.id, roleMentioned.name]);
                                                    emojiArray.push(unicodeStored);
                                                    roleArray.push(roleMentioned.id);
                                                    reAsk(message);
                                                } else {
                                                    if (errorCatch > 0) {
                                                        errorCatch -= 1;
                                                        reAsk(message, `Podaj poprawne niestandardowe emoji!\n${localEmojiG}\nPozostało prób - ${errorCatch}`);
                                                    } else {
                                                        message.delete();
                                                        msg.channel.send(`Monit został anulowany, podałeś nieprawidłowe niestandardowe emoji!\n${localEmojiG}\nWykonaj ponownie polecenie, aby ponownie przejść do monitu!`);
                                                    }
                                                }
                                            } else {
                                                reactionArray.push([unicodeStored, roleMentioned.id, roleMentioned.name]);
                                                emojiArray.push(unicodeStored);
                                                roleArray.push(roleMentioned.id);
                                                reAsk(message);
                                            }

                                        } else {

                                            if (errorCatch > 0) {
                                                errorCatch -= 1;
                                                reAsk(message, `Nie używaj dwukrotnie tego samego emoji!\nPozostało prób - ${errorCatch}`)
