}

function done(message) {
    var finalText = "";
    reactionArray.forEach(subarray => {
        finalText = finalText + `${subarray[0]} => ${subarray[2]}\n`
    })
    message.edit(`Ostateczne menu konformacji\n\nPoniżej znajduje się lista reakcji na ich role\n${finalText}\n\nJeśli jest to poprawne, prosimy o odpowiedź z kanałem tekstowym, do którego zostanie wysłane menu roli.\nJeśli nie jest to poprawne, odpowiedz „cancel”, aby anulować monit.`)
    msg.channel.awaitMessages(response => response.author.id == msg.author.id, {
            max: 1,
            time: 60000,
            errors: ['time'],
        })
        .then((collected) => {
            msg.author.lastMessage.delete();
            if (collected.first().mentions.channels.first()) {
                var menchannel = collected.first().mentions.channels.first()
                message.delete();
                menchannel.send({
                        embed: {
                            color: 0xffff00,
                            title: "Zareaguj aby otrzymać role",
